import React from 'react'

function Cart({ images }) {
  return (
    <section>
        <div className="cart-pic"><img alt='' src={images[0].image_url}></img></div>
        <div className="cart-place"></div>
        <div className="cart-quanity"></div>
        <div className="cart-price"></div>
    </section>
  )
}

export default Cart
